Information
------------------------------

Seasons of A Navajo carries through a year in the life of a family as grandparents pass on the ancient traditions of their people. Told in their own words, this sensitive portrait of a traditional Navajo family reveals a world where &quot;living well&quot; means kinship with the earth and unceasing hard work. Filmed in Monument Valley, Canyon de Chelly and Window Rock, the program offers majestic panoramas of the breathtaking beauty of the Southwest.

